    <main>
      <section className="profile">
        <div className="profile__main">
          <div className="profile__avatar-container">
            <img onClick={props.onEditAvatar} alt="Аватар профиля" className="profile__avatar"/>
            <div className="profile__avatar_overlay"></div>
          </div>
          <div className="profile__info">
            <div className="profile__row">
              <h2 className="profile__name"></h2>
              <button onClick={props.onEditProfile} type="button" className="profile__edit"></button>
            </div>
            <p className="profile__description"></p>
          </div>
        </div>
        <button onClick={props.onAddPlace} type="button" className="profile__add"></button>
      </section>

      <section>
        <ul className="elements">
        </ul>
      </section>
    </main>
  )
}
